import React,{ Component } from "react";

export class SideBar extends Component{
constructor(props:any)
{
    super(props);
}

render(){

    return(
        <div className='navbar-theme navbar navbar-default'>
            <div className='navbar-header'>
                <a className='navbar-brand' style={{color:"white",fontSize:'x-larger',left:'5%',position:'absolute'}} href="#">React Demo</a>
            </div>
        </div>
    )
}


}
